import * as React from 'react';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import ImageListItemBar from '@mui/material/ImageListItemBar';

export default function TitlebarBelowImageList() {
  return (
    <ImageList sx={{ width: 500, height: 450 }}>

          <img
            src="https://www.treasurers.org/system/files/fundamentals.jpg"
            loading="lazy"
          />
          <ImageListItemBar
            title='Calculate Just Any Thing'
            subtitle={<p>The best website in calculations all you need in one place need not to worry from now on , we provide the service you need ,work smart , better to start now 
              </p>}
            position="below"
          />


    </ImageList>
  );
}
